import React from "react";
import GameCell from "./GameCell";

export default class GameRow extends React.Component{
    constructor(props){
        super(props);
    }
    render(){
        return(
            <div className="gridRow" id={this.props.id}>
                {
                    this.props.value.map(
                        (element, index) => {
                            return(
                                <GameCell key={index} value={element} id={index}/>
                            );
                        }
                    )
                }
            </div>
        );
    }
}
